package model;import java.util.Arrays;import java.util.Date;public class Course {    private String id;    private String title;    private String [] instructureName;    private String  [] requirement;    private Date startDate;    public Course(String id, String title, String[] instructureName, String[] requirement, Date startDate) {        this.id = id;        this.title = title;        this.instructureName = instructureName;        this.requirement = requirement;        this.startDate = startDate;    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String[] getInstructureName() {        return instructureName;    }    public void setInstructureName(String[] instructureName) {        this.instructureName = instructureName;    }    public String[] getRequirement() {        return requirement;    }    public void setRequirement(String[] requirement) {        this.requirement = requirement;    }    public Date getStartDate() {        return startDate;    }    public void setStartDate(Date startDate) {        this.startDate = startDate;    }    @Override    public String toString() {        return "Course{" +                "id='" + id + '\'' +                ", title='" + title + '\'' +                ", instructureName=" + Arrays.toString(instructureName) +                ", requirement=" + Arrays.toString(requirement) +                ", startDate=" + startDate +                '}';    }}